window.bookSummaryJSON = "<p><b>The seductive and thrilling first book in the </b><b><i>Wings of Ink </i></b><b>epic romantic fantasy series from award-winning author Angelina J. Steffort.</b></p> <p>Stuck in prison, pirate Wolayna Milevishja is waiting to be dealt her punishment—one worse than death, her captors promised when they closed the door of her cell over nine months ago.</p> <p>Now that punishment has come to collect her.</p> <p>Wolayna is taken to the mystical fairylands as this year’s bride for the Crow King, and that, even the humans in this world know, means there is no hope.</p> <p>As Wolayna quarrels with her fate, frosty disdain melts into heart-stopping attraction, and she realizes that, maybe, King Myron, has just as little choice as she has. Something ancient and vengeful is at work in the Crow realm, and the intrigue at court is just the surface of the looming danger closing in on them.</p> <p>Will Wolayna outsmart fate and find the freedom she’s owed, or will this new world of winged horror and surprising beauty be the death of her?</p> <p>If you like witty, independent heroines and morally-grey, tormented heroes, you will devour this sizzling, addictive fantasy adventure.</p> <p><b>Perfect for fans of </b><b><i>A Court of Thorns and Roses</i></b><b>, </b><b><i>From Blood and Ash,</i></b><b> and</b><b><i> Beauty and the Beast</i></b><b>, </b><b><i>WINGS OF INK</i></b><b> is an epic romantic fantasy with enemies-to-lovers, arranged marriage, slow-burn spice, and a magical world filled with mysteries and monsters.</b></p>"; 
